    [],nt"revision_timestamp": "2013-11-27T19:35:42.817816",nt"name": "2013-fema-flood-hazard-area",nt"isopen":
    false,nt"url": null,nt"notes": " The National Flood Hazard Layer (NFHL)
    data incorporates all Digital Flood Insurance RatenMap(DFIRM) databases published
    by FEMA, and any Letters Of Map Revision (LOMRs) that have beennissued against those
    databases since their publication date. The DFIRM Database is the digital,ngeospatial
    version of the flood hazard information shown on the published paper Flood Insurance
    RatenMaps(FIRMs). The primary risk classifications used are the 1-percent-annual-chance
    flood event, then0.2-percent-annual-chance flood event, and areas of minimal flood
    risk. The NFHL data are derivednfrom Flood Insurance Studies (FISs), previously
    published Flood Insurance Rate Maps (FIRMs), floodnhazard analyses performed in
    support of the FISs and FIRMs, and new mapping data where available.nThe FISs and
    FIRMs are published by the Federal Emergency Management Agency (FEMA). Thenspecifications
    for the horizontal control of DFIRM data are consistent with those required fornmapping
    at a scale of 1:12,000. The NFHL data contain layers in the Standard DFIRM datasets
    exceptnfor S_Label_Pt and S_Label_Ld. The NFHL is available as State or US Territory
    data sets. Each Statenor Territory data set consists of all DFIRMs and corresponding
    LOMRs available on the publicationndate of the data set. ",nt"license_title":
